title: Mutual recursion in a chain of inheritance
description: >
  The defect manifests in the form of call chain cycles.
  The following cycles are present here:
  o697.m2 -> o713.m1 -> o713.m3 -> o697.m2
  o713.m1 -> o713.m3 -> o697.m2 -> o713.m1
  o713.m3 -> o697.m2 -> o713.m1 -> o713.m3

features:
  - inheritance
  - overriding
  - method
  - polymorphism

